import React, { useEffect, useState } from 'react'
import './App.css'
import RepeatingDos from './RepeatingDos'
import useLocalStorageState from 'use-local-storage-state'
import Events from './event/Events'
import { defaultToDoData } from './storage/Storage'
import Storage from './storage/Storage'
import { MinuteMilliseconds, TodoStorageKey } from './Constants'
import Notes from './Notes'
import { CalendarApiClient } from 'google-calendar-api-client'

function App() {
  const [, setStateToForceRerender] = useState(new Date())
  const [todoStorage] = useLocalStorageState(TodoStorageKey, {
    defaultValue: defaultToDoData
  })

  useEffect(() => {
    setInterval(() => {
      setStateToForceRerender(new Date())
    }, MinuteMilliseconds)
  }, [])

  console.log(`Client: ${process.env.CLIENT_ID}`)

const apiClient = new CalendarApiClient({
  clientId: "261912703565-hop0sl5u08fodcd9qvtd4vk2ha3rcc2d.",//process.env.CLIENT_ID,
  apiKey: "AIzaSyBtTUouk4zCjNwrQMQov14i9Duj_JNS_Ec",// process.env.API_KEY,
  scope: "https://www.googleapis.com/auth/calendar.events",
  discoveryDocs: ["https://www.googleapis.com/discovery/v1/apis/calendar/v3/rest"],
})

  return (
    <div className="App">
      <Events />
      <div>-----------------------------------------------------------------------</div>
      <RepeatingDos data={todoStorage.todos} />
      <div>-----------------------------------------------------------------------</div>
      <Notes/>
      <div>-----------------------------------------------------------------------</div>
      <Storage />
    </div>
  )
}

export default App
